$_MODULE['<{usercentrics}prestashop>information_68415e5643f2fbf2f746776d23eb45a0'] = 'Since the GDPR (General Data Protection Regulation) came into effect in May 2018, website operators require a legal basis for the use of web technologies such as cookies, or pixels that are used for marketing purposes. In most of the cases that legal basis is the user’s consent. GDPR compliant consent must be the following: Revocable - informed - documented - given in advance - granular - voluntary and explicit.';
$_MODULE['<{usercentrics}prestashop>information_f946416fb58e24771d78cc62c8ed1ddb'] = 'The Usercentrics Consent Management Platform (CMP) allows you to comply with GDPR regulations and obtain, manage and document the consent of your website visitors in a GDPR-compliant manner.';
$_MODULE['<{usercentrics}prestashop>information_3ecf65be37c4d78b5570bcdc560af467'] = 'With Usercentrics, you can minimise your legal risks and protect yourself from warnings and fines. Furthermore, a CMP helps you to protect your advertising revenue, since a lack of user consent can lead to considerable restrictions in your digital marketing strategy.';
$_MODULE['<{usercentrics}prestashop>information_325151228d4af3ba386c4d3f2d8b8d78'] = 'Usercentrics Meets All Requirements for a CMP';
